import React from 'react'
import {withStyles} from "@material-ui/styles"

//Define Styles ↓
const styles={
"h1":{
  fontSize:"100px"
}
}
function Hero(props){
  const {classes,slogan,content} = props
  return (
    <div>
      <h1>{slogan}</h1>
      <p>{content}</p>
    </div>
  )
}

export default withStyles(styles)(Hero);
